import React, { Component } from "react";
import Header from "../Header/Header";

export default class Home extends Component {
  render() {
    return (
      <div className="home-page">
        <Header back={<span onClick={()=>{this.props.history.go(-1)}}></span>}></Header>
      </div>
    );
  }
}
